import axios from 'axios'
import React, { useEffect, useState } from 'react'

function CricketDataFetch() {
    const[posts,setposts]=useState([])

    useEffect(() => {
        axios.get(`https://cricapi.com/api/matches/rXH9Y3RJu3YVsF51R6FSTwLR24h2`)
        .then(Response=>{
            //console.log(Response.data.matches)
            setposts(Response.data.matches)
            })
            .catch(error=>{
                console.log(error)
            })
    })
    return (
        <div>List Of Matches
            posts.length?
            posts.map((post) =>{
            <li><div key={post["unique_id"]}>{post["team-1"]} VS {post["team-2"]}
            <h4>Winner of the match: {post["winner_team"]}</h4></div>
            </li>
            }):null
        
        </div>
    )
}

export default CricketDataFetch
